import React, { useState } from 'react';
import { Search, SortTable, Catalog, Home} from "./components/pages";
import {Route, Routes} from "react-router-dom";
import {Navbar} from "./components/Navbar";
import './app.css'
const App = () => {
  const [products, setProducts] = useState([
    {
      id:'1',
      name: 'Ключ фей',
      cost: 400,
      quantity: 10,
      image: 'key.png',
      description: 'cвойства: открывает практически любой замок, после 2 использований уничтожается',
      isNew: true,
      weight: 0.5,
      discount: 10
    },
    {
      id:'2',
      name: 'Зелье звёздного света',
      cost: 10,
      quantity: 20,
      image: 'potion.png',
      description: 'Свойства: создаёт сгусток света освещающий все вокруг выпившего в радиусе 50 метров',
      isNew: false,
      weight: 0.1,
      discount: 0
    },
    {
      id:'3',
      name: 'Костюм фетрийского аристократа',
      cost: 1000,
      quantity: 10,
      image: 'cloth.png',
      description: 'Описание: одежда аристократов одного из миров с магическим возвышением, покрыта магическими рунами для разных целей. Характеристики: 150 физ, 150 энерго. Вес 0.5',
      isNew: true,
      weight: 1,
      discount: 0
    },
  ]);
  return (
      <div className="App">
        <header>
          <Navbar/>
        </header>
        <main>
          <Routes>
            <Route path="/SortTable" element={<SortTable products={products}/>}/>
            <Route path="/Catalog" element={<Catalog products={products} />}/>
            <Route path="/" element={<Home/>}/>
            <Route path="/Search" element={<Search products={products}/>}/>
            <Route path="/order" element={<Search products={products}/>}/>
          </Routes>
        </main>
      </div>

  );
}
export default App;
